import Product from "./Product";
function Products_List() {
    return (
        <div className="products">
                <Product img="https://unsplash.com/1600x1000/?iphone" name="Iphone 14" price="72000"/>
                <Product img="https://unsplash.com/1600x1000/?samsungphone" name="Samsung s23 Ultra" price="129000"/>
                <Product img="https://unsplash.com/1600x1000/?pixelphone" name="Pixel 7" price="79000"/>
        </div>
    );
}

export default Products_List;
